			shellScript = "set -e\n\n# Ignoring uninitialised variable (probably running from main \"process\")\nset +u\n    # Avoid recursively calling this script.\n    if [[ $BUILDING_USER_DEFINED_TARGET ]]; then\n        echo \"{WARN} Already running build of ${PROJECT_NAME} for ${SDK_NAME}\"\n\n        # Notified and we are done here\n        exit 0\n    fi\nset -u\n\n# Set environment variable to prevent cycles from attempt to\n# universal static with opposite SDK\nexport BUILDING_USER_DEFINED_TARGET=1\n\n# Declare path to PubNub library build results.\nPRODUCT_DIR=\"${SRCROOT}/lib\"\n\n# Extracting platform name (simulator or device)\nif [[ \"$SDK_NAME\" =~ ([A-Za-z]+) ]]; then\n\tTARGET_PLATFORM=${BASH_REMATCH[1]}\nelse\n\n\techo \"{ERROR} Unkonwn platform: ${SDK_NAME}\"\n\n\t# We got error so we should report and stop aggregation target build process\n\texit 1\nfi\n\nif [ \"$TARGET_PLATFORM\" == \"iphoneos\" ] || [ \"$TARGET_PLATFORM\" == \"iphonesimulator\" ] ; then\n\n    # Extracting SDK version used to deploy on specified platform\n    if [[ \"$SDK_NAME\" =~ ([0-9]+.*$) ]]; then\n        TARGET_SDK_VERSION=${BASH_REMATCH[1]}\n    else\n        echo \"{ERROR} Unkonwn SDK version: $SDK_NAME\"\n\n        # We got error so we should report and stop aggregation target build process\n        exit 1\n    fi\n\n    # Find out secondary platform which should be built and path there it will be stored\n    SCRIPT_DEFINED_TARGET=`[ \"$TARGET_PLATFORM\" == \"iphoneos\" ] && echo \"iphonesimulator\" || echo \"iphoneos\"`\n    SCRIPT_DEFINED_TARGET_PATH=${BUILT_PRODUCTS_DIR%$TARGET_PLATFORM}$SCRIPT_DEFINED_TARGET\n    SCRIPT_DEFINED_SDK_NAME=${SCRIPT_DEFINED_TARGET}${TARGET_SDK_VERSION}\n\n    # Declare path to PubNub library build results.\n    PRODUCT_DIR=\"${SRCROOT}/lib\"\n    # Compose target library product name.\n    STATIC_LIB_FILE_NAME=\"lib${PROJECT_NAME}.a\"\n\n    # Rename compiled for current target static library.\n    /bin/mv \"${PRODUCT_DIR}/${STATIC_LIB_FILE_NAME}\" \"${PRODUCT_DIR}/lib${PROJECT_NAME}-${TARGET_PLATFORM}.a\"\n\n    # Build for another platform\n    xcrun xcodebuild -project \"${PROJECT_FILE_PATH}\" -target \"${TARGET_NAME}\" -configuration \"${CONFIGURATION}\" -sdk ${SCRIPT_DEFINED_SDK_NAME} BUILD_DIR=\"${BUILD_DIR}\" OBJROOT=\"${OBJROOT}\" BUILD_ROOT=\"${BUILD_ROOT}\" SYMROOT=\"${SYMROOT}\" $ACTION\n\n    # Copy PubNub library build results to product directory.\n    /bin/cp \"${SCRIPT_DEFINED_TARGET_PATH}/${STATIC_LIB_FILE_NAME}\" \"${PRODUCT_DIR}/lib${PROJECT_NAME}-${SCRIPT_DEFINED_TARGET}.a\"\n\n    # Create fat binary using lipo and store it inside of original target .framework (created previously by static library post-build script).\n    xcrun lipo -create \"${PRODUCT_DIR}/lib${PROJECT_NAME}-${TARGET_PLATFORM}.a\" \"${PRODUCT_DIR}/lib${PROJECT_NAME}-${SCRIPT_DEFINED_TARGET}.a\" -output \"${PRODUCT_DIR}/${STATIC_LIB_FILE_NAME}\"\n\n    # Clean up\n    /bin/rm \"${PRODUCT_DIR}/lib${PROJECT_NAME}-${TARGET_PLATFORM}.a\"\n    /bin/rm \"${PRODUCT_DIR}/lib${PROJECT_NAME}-${SCRIPT_DEFINED_TARGET}.a\"\nfi";
